import React from 'react';
import './App.css';

function App() {
  return (
    <div>
      <div className="App">
        <h1> Nabeel Naiyer </h1>
      </div>
      <div className="TopBar">
        <h2> Contact </h2>
      </div>
    </div>
  );
}

export default App;
